                         skeleton={nodes.EyeLeft.skeleton}/>
            <skinnedMesh name="EyeRight" geometry={nodes.EyeRight.geometry} material={materials.Wolf3D_Eye}
                         skeleton={nodes.EyeRight.skeleton}/>
            <skinnedMesh name="Wolf3D_Head" geometry={nodes.Wolf3D_Head.geometry} material={materials.Wolf3D_Skin}
                         skeleton={nodes.Wolf3D_Head.skeleton}/>
            <skinnedMesh name="Wolf3D_Teeth" geometry={nodes.Wolf3D_Teeth.geometry} material={materials.Wolf3D_Teeth}
                         skeleton={nodes.Wolf3D_Teeth.skeleton}/>
            <skinnedMesh geometry={nodes.Wolf3D_Outfit_Top.geometry} material={materials.Wolf3D_Outfit_Top}
                         skeleton={nodes.Wolf3D_Outfit_Top.skeleton}/>
            <skinnedMesh geometry={nodes.Wolf3D_Outfit_Bottom.geometry} material={materials.Wolf3D_Outfit_Bottom}
                         skeleton={nodes.Wolf3D_Outfit_Bottom.skeleton}/>
            <skinnedMesh geometry={nodes.Wolf3D_Outfit_Footwear.geometry} material={materials.Wolf3D_Outfit_Footwear}
                         skeleton={nodes.Wolf3D_Outfit_Footwear.skeleton}/>
            <skinnedMesh geometry={nodes.Wolf3D_Body.geometry} material={materials.Wolf3D_Body}
                         skeleton={nodes.Wolf3D_Body.skeleton}/>
        </group>
    )
}

